import React, { useState, useEffect } from 'react';
import '../styles/Cart.css';

const Cart = () => {
  const [cartItems, setCartItems] = useState([]);
  const [subtotal, setSubtotal] = useState(0);
  const [deliveryMethod, setDeliveryMethod] = useState('pickup');
  const [deliveryFee, setDeliveryFee] = useState(0);

  useEffect(() => {
    // In a real application, you would fetch cart items from an API or context
    const mockCartItems = [
      { id: 1, name: 'Running Shoe 1', price: 99.99, quantity: 1 },
      { id: 2, name: 'Jogging Shoe 1', price: 79.99, quantity: 2 },
    ];
    setCartItems(mockCartItems);
  }, []);

  useEffect(() => {
    const newSubtotal = cartItems.reduce((sum, item) => sum + item.price * item.quantity, 0);
    setSubtotal(newSubtotal);
  }, [cartItems]);

  const handleQuantityChange = (id, newQuantity) => {
    setCartItems(cartItems.map(item => 
      item.id === id ? { ...item, quantity: parseInt(newQuantity) } : item
    ));
  };

  const handleRemoveItem = (id) => {
    setCartItems(cartItems.filter(item => item.id !== id));
  };

  const handleDeliveryMethodChange = (event) => {
    setDeliveryMethod(event.target.value);
    setDeliveryFee(event.target.value === 'delivery' ? 5.99 : 0);
  };

  const total = subtotal + deliveryFee;

  return (
    <div className="cart-container">
      <h2>Your Cart</h2>
      {cartItems.length === 0 ? (
        <p>Your cart is empty.</p>
      ) : (
        <>
          {cartItems.map((item) => (
            <div key={item.id} className="cart-item">
              <h3>{item.name}</h3>
              <p>Price: ${item.price.toFixed(2)}</p>
              <div>
                <label htmlFor={`quantity-${item.id}`}>Quantity:</label>
                <input
                  id={`quantity-${item.id}`}
                  type="number"
                  value={item.quantity}
                  onChange={(e) => handleQuantityChange(item.id, e.target.value)}
                  min="1"
                />
              </div>
              <p>Total: ${(item.price * item.quantity).toFixed(2)}</p>
              <button onClick={() => handleRemoveItem(item.id)}>Remove</button>
            </div>
          ))}

          <div className="delivery-options">
            <h3>Delivery Method</h3>
            <label>
              <input
                type="radio"
                value="pickup"
                checked={deliveryMethod === 'pickup'}
                onChange={handleDeliveryMethodChange}
              />
              Store Pickup (Free)
            </label>
            <label>
              <input
                type="radio"
                value="delivery"
                checked={deliveryMethod === 'delivery'}
                onChange={handleDeliveryMethodChange}
              />
              Home Delivery ($5.99)
            </label>
          </div>

          <div className="cart-summary">
            <h3>Order Summary</h3>
            <p>Subtotal: ${subtotal.toFixed(2)}</p>
            {deliveryMethod === 'delivery' && (
              <p>Delivery Fee: ${deliveryFee.toFixed(2)}</p>
            )}
            <h4>Total: ${total.toFixed(2)}</h4>
          </div>

          <button className="checkout-button" onClick={() => {
            // Here you would typically redirect to a checkout page or process the order
            console.log('Proceeding to checkout');
          }}>
            Proceed to Checkout
          </button>
        </>
      )}
    </div>
  );
};

export default Cart;
